// import Navbar from './navbar';
// import Home from './Home';

function App() {
    const userName = "John";
  return (
    // <div className="App">
    //     <Navbar />
    //   <div className="contents">
    //      <Home />
    //   </div>

    //   <aside>Side bar</aside>

    // </div>

    <div style={{ display: 'flex', height: '100vh' }}>
      {/* Sidebar */}
      <div style={{ width: '25%', backgroundColor: '#f8f8f8', padding: '20px', boxShadow: '2px 0 5px rgba(0, 0, 0, 0.1)', display: 'flex', flexDirection: 'column', alignItems: 'center' }}>
        <h2>{userName}'s Health Companion style={{topPadding: ''}}</h2>
        <button style={{ backgroundColor: '#000', color: '#fff', border: 'none', padding: '10px 20px', fontSize: '16px', cursor: 'pointer', borderRadius: '5px', marginTop: '20px' }}>View My Healthcard</button>
      </div>

      {/* Chat Area */}
      <div style={{ flex: 1, display: 'flex', flexDirection: 'column', justifyContent: 'space-between', paddingTop: '600px', paddingLeft: '20px', paddingRight: '20px' }}>

        {/* Input and Button Section */}
        <div style={{ marginTop: '20px', display: 'flex', flexDirection: 'column', gap: '10px' }}>
          <input type="text" placeholder="How can MediCompanion help?" style={{ padding: '10px', fontSize: '16px', border: '1px solid #ddd', borderRadius: '5px', flex: 1 }} />
          <div style={{ display: 'flex', gap: '10px' }}>
            <button style={{ padding: '10px 20px', fontSize: '14px', border: 'none', borderRadius: '5px', backgroundColor: '#ddd', cursor: 'pointer' }}>Prescriptions...</button>
            <button style={{ padding: '10px 20px', fontSize: '14px', border: 'none', borderRadius: '5px', backgroundColor: '#ddd', cursor: 'pointer' }}>Vaccines...</button>
            <button style={{ padding: '10px 20px', fontSize: '14px', border: 'none', borderRadius: '5px', backgroundColor: '#ddd', cursor: 'pointer' }}>I feel sick...</button>
          </div>
        </div>
      </div>
    </div>
  );
}

export default App;
